crosoft YaHei\'; border-style: none; border-width: initial; font-size: 9px; display: inline-block; width: 16px; height: 16px; text-indent: -2000px; background-image: url(http://static.blog.csdn.net/scripts/SyntaxHighlighter/styles/images/default/ico_plain.gif); background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0% 0%; background-repeat: no-repeat;\" _href=\"http://blog.csdn.net/yangzhaomuma/article/details/51173138#\">view plain <a href=\"http://blog.csdn.net/yangzhaomuma/article/details/51173138#\" class=\"CopyToClipboard\" title=\"copy\" style=\"color: rgb(160, 160, 160); margin: 0px 10px 0px 0px; padding: 1px; border-style: none; border-width: initial; font-size: 9px; display: inline-block; width: 16px; height: 16px; text-indent: -2000px; background-image: url(http://static.blog.csdn.net/scripts/SyntaxHighlighter/styles/images/default/ico_copy.gif); background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0% 0%; background-repeat: no-repeat;\" _href=\"http://blog.csdn.net/yangzhaomuma/article/details/51173138#\">copy\n <a href=\"https://code.csdn.net/snippets/1650503\" target=\"_blank\" title=\"在CODE上查看代码片\" style=\"color: rgb(160, 160, 160); margin: 0px 10px 0px 0px; padding: 1px; border-style: none; border-width: initial; font-size: 9px; display: inline-block; width: 16px; height: 16px; background-image: none; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0% 0%; background-repeat: no-repeat;\" _href=\"https://code.csdn.net/snippets/1650503\"><img src=\"https://code.csdn.net/assets/CODE_ico.png\" width=\"12\" height=\"12\" alt=\"在CODE上查看代码片\" style=\"border-style: none; border-width: initial; outline: none; max-width: 100%; position: relative; top: 1px; left: 2px;\"><a href=\"https://code.csdn.net/snippets/1650503/fork\" target=\"_blank\" title=\"派生到我的代码片\" style=\"color: rgb(160, 160, 160); margin: 0px 10px 0px 0px; padding: 1px; border-style: none; border-width: initial; font-size: 9px; display: inline-block; width: 16px; height: 16px; background-image: none; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0% 0%; background-repeat: no-repeat;\" _href=\"https://code.csdn.net/snippets/1650503/fork\"><img src=\"https://code.csdn.net/assets/ico_fork.svg\" width=\"12\" height=\"12\" alt=\"派生到我的代码片\" style=\"border-style: none; border-width: initial; outline: none; max-width: 100%; position: relative; top: 2px; left: 2px;\">\n\nString teString=null;              teString=String.valueOf(teString);              System.out.println(teString);  \n\n这样的写法，因为确定了传入的是String类型，在valueOf调用对应构造函数时不会发生错误，因此，返回的是字符串“null”。\n[html] <a href=\"http://blog.csdn.net/yangzhaomuma/article/details/51173138#\" class=\"ViewSource\" title=\"view plain\" style=\"color: rgb(160, 160, 160); margin: 0px 10px 0px 0px; padding: 1px; font-family: \'Microsoft YaHei\'; border-style: none; border-width: initial; font-size: 9px; display: inline-block; width: 16px; height: 16px; text-indent: -2000px; background-image: url(http://static.blog.csdn.net/scripts/SyntaxHighlighter/styles/images/default/ico_plain.gif); background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0% 0%; background-repeat: no-repeat;\" _href=\"http://blog.csdn.net/yangzhaomuma/article/details/51173138#\">view plain <a href=\"http://blog.csdn.net/yangzhaomuma/article/details/51173138#\" class=\"CopyToClipboard\" title=\"copy\" style=\"color: rgb(160, 160, 160); margin: 0px 10px 0px 0px; padding: 1px; border-style: none; border-width: initial; font-size: 9px; display: inline-block; width: 16px; height: 16px; text-indent: -2000px; background-image: url(http://static.blog.csdn.net/scripts/SyntaxHighlighter/styles/images/default/ico_copy.gif); background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0% 0%; background-repeat: no-repeat;\" _href=\"http://blog.csdn.net/yangzhaomuma/article/details/51173138#\">copy\n <a href=\"https://code.csdn.net/snippets/1650503\" target=\"_blank\" title=\"在CODE上查看代码片\" style=\"color: rgb(160, 160, 160); margin: 0px 10px 0px 0px; padding: 1px; border-style: none; border-width: initial; font-size: 9px; display: inline-block; width: 16px; height: 16px; background-image: none; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0% 0%; background-repeat: no-repeat;\" _href=\"https://code.csdn.net/snippets/1650503\"><img src=\"https://code.csdn.net/assets/CODE_ico.png\" width=\"12\" height=\"12\" alt=\"在CODE上查看代码片\" style=\"border-style: none; border-width: initial; outline: none; max-width: 100%; position: relative; top: 1px; left: 2px;\"><a href=\"https://code.csdn.net/snippets/1650503/fork\" target=\"_blank\" title=\"派生到我的代码片\" style=\"color: rgb(160, 160, 160); margin: 0px 10px 0px 0px; padding: 1px; border-style: none; border-width: initial; font-size: 9px; display: inline-block; width: 16px; height: 16px; background-image: none; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0% 0%; background-repeat: no-repeat;\" _href=\"https://code.csdn.net/snippets/1650503/fork\"><img src=\"https://code.csdn.net/assets/ico_fork.svg\" width=\"12\" height=\"12\" alt=\"派生到我的代码片\" style=\"border-style: none; border-width: initial; outline: none; max-width: 100%; position: relative; top: 2px; left: 2px;\">\n\nString.valueOf(null);  \n\n但如果改为以上的写法，则提示空指针。\n\n问题分析：为何会出现以上两种不同的结果，看源码我们即可知道原因。\nvalueOf有以下几种重载：\n<img src=\"http://img.blog.csdn.net/20160417143946002?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQv/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/Center\" alt=\"\" style=\"border-style: none; border-width: initial; outline: none; max-width: 100%;\">\n在代码中写下如下：\n\n[html] <a href=\"http://blog.csdn.net/yangzhaomuma/article/details/51173138#\" class=\"ViewSource\" title=\"view plain\" style=\"color: rgb(160, 160, 160); margin: 0px 10px 0px 0px; padding: 1px; font-family: \'Microsoft YaHei\'; border-style: none; border-width: initial; font-size: 9px; display: inline-block; width: 16px; height: 16px; text-indent: -2000px; background-image: url(http://static.blog.csdn.net/scripts/SyntaxHighlighter/styles/images/default/ico_plain.gif); background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0% 0%; background-repeat: no-repeat;\" _href=\"http://blog.csdn.net/yangzhaomuma/article/details/51173138#\">view plain <a href=\"http://blog.csdn.net/yangzhaomuma/article/details/51173138#\" class=\"CopyToClipboard\" title=\"copy\" style=\"color: rgb(160, 160, 160); margin: 0px 10px 0px 0px; padding: 1px; border-style: none; border-width: initial; font-size: 9px; display: inline-block; width: 16px; height: 16px; text-indent: -2000px; background-image: url(http://static.blog.csdn.net/scripts/SyntaxHighlighter/styles/images/default/ico_copy.gif); background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0% 0%; background-repeat: no-repeat;\" _href=\"http://blog.csdn.net/yangzhaomuma/article/details/51173138#\">copy\n <a href=\"https://code.csdn.net/snippets/1650503\" target=\"_blank\" title=\"在CODE上查看代码片\" style=\"color: rgb(160, 160, 160); margin: 0px 10px 0px 0px; padding: 1px; border-style: none; border-width: initial; font-size: 9px; display: inline-block; width: 16px; height: 16px; background-image: none; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0% 0%; background-repeat: no-repeat;\" _href=\"https://code.csdn.net/snippets/1650503\"><img src=\"https://code.csdn.net/assets/CODE_ico.png\" width=\"12\" height=\"12\" alt=\"在CODE上查看代码片\" style=\"border-style: none; border-width: initial; outline: none; max-width: 100%; position: relative; top: 1px; left: 2px;\"><a href=\"https://code.csdn.net/snippets/1650503/fork\" target=\"_blank\" title=\"派生到我的代码片\" style=\"color: rgb(160, 160, 160); margin: 0px 10px 0px 0px; padding: 1px; border-style: none; border-width: initial; font-size: 9px; display: inline-block; width: 16px; height: 16px; background-image: none; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0% 0%; background-repeat: no-repeat;\" _href=\"https://code.csdn.net/snippets/1650503/fork\"><img src=\"https://code.csdn.net/assets/ico_fork.svg\" width=\"12\" height=\"12\" alt=\"派生到我的代码片\" style=\"border-style: none; border-width: initial; outline: none; max-width: 100%; position: relative; top: 2px; left: 2px;\">\n\nboolean temp = false;             String.valueOf(temp);                          char temp1 = 0;             String.valueOf(temp1);                          double value = 0;             String.valueOf(value);                          Object object=null;             String.valueOf(object);                          float f = 0;            String.valueOf(f);                        int i = 0;            String.valueOf(i);                        long l = 0;            String.valueOf(l);                        System.out.println(\"------------分割线---------------\");                        //导致空指针          char[] chars=null;          String.valueOf(chars);                     //导致空指针           String.valueOf(null, 0, 0);  \n\n运行后，可看到导致空指针的只可能是后面的两种方式。源码中valueOf(char[])会最终走到valueOf(char[],int,int)这个重载中，因此我们直接看对应的源码，如下：\n\n\n[html] <a href=\"http://blog.csdn.net/yangzhaomuma/article/details/51173138#\" class=\"ViewSource\" title=\"view plain\" style=\"color: rgb(160, 160, 160); margin: 0px 10px 0px 0px; padding: 1px; font-family: \'Microsoft YaHei\'; border-style: none; border-width: initial; font-size: 9px; display: inline-block; width: 16px; height: 16px; text-indent: -2000px; background-image: url(http://static.blog.csdn.net/scripts/SyntaxHighlighter/styles/images/default/ico_plain.gif); background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0% 0%; background-repeat: no-repeat;\" _href=\"http://blog.csdn.net/yangzhaomuma/article/details/51173138#\">view plain <a href=\"http://blog.csdn.net/yangzhaomuma/article/details/51173138#\" class=\"CopyToClipboard\" title=\"copy\" style=\"color: rgb(160, 160, 160); margin: 0px 10px 0px 0px; padding: 1px; border-style: none; border-width: initial; font-size: 9px; display: inline-block; width: 16px; height: 16px; text-indent: -2000px; background-image: url(http://static.blog.csdn.net/scripts/SyntaxHighlighter/styles/images/default/ico_copy.gif); background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0% 0%; background-repeat: no-repeat;\" _href=\"http://blog.csdn.net/yangzhaomuma/article/details/51173138#\">copy\n <a href=\"https://code.csdn.net/snippets/1650503\" target=\"_blank\" title=\"在CODE上查看代码片\" style=\"color: rgb(160, 160, 160); margin: 0px 10px 0px 0px; padding: 1px; border-style: none; border-width: initial; font-size: 9px; display: inline-block; width: 16px; height: 16px; background-image: none; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0% 0%; background-repeat: no-repeat;\" _href=\"https://code.csdn.net/snippets/1650503\"><img src=\"https://code.csdn.net/assets/CODE_ico.png\" width=\"12\" height=\"12\" alt=\"在CODE上查看代码片\" style=\"border-style: none; border-width: initial; outline: none; max-width: 100%; position: relative; top: 1px; left: 2px;\"><a href=\"https://code.csdn.net/snippets/1650503/fork\" target=\"_blank\" title=\"派生到我的代码片\" style=\"color: rgb(160, 160, 160); margin: 0px 10px 0px 0px; padding: 1px; border-style: none; border-width: initial; font-size: 9px; display: inline-block; width: 16px; height: 16px; background-image: none; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: 0% 0%; background-repeat: no-repeat;\" _href=\"https://code.csdn.net/snippets/1650503/fork\"><img src=\"https://code.csdn.net/assets/ico_fork.svg\" width=\"12\" height=\"12\" alt=\"派生到我的代码片\" style=\"border-style: none; border-width: initial; outline: none; max-width: 100%; position: relative; top: 2px; left: 2px;\">\n\npublic String(char[] data, int offset, int charCount) {         if ((offset | charCount) &lt; 0 || charCount &gt; data.length - offset) {             throw failedBoundsCheck(data.length, offset, charCount);         }         this.offset = 0;         this.value = new char[charCount];         this.count = charCount;         System.arraycopy(data, offset, value, 0, count);     }  \n\n这里将导致空指针。\n\n\n知道了导致空指针的原因，还有一个疑惑，那就是为什么String.valueOf(null)，会走到valueOf(char[])这个重载，而不是其他重载呢？\n因为java中对重载的匹配是，当重载都能匹配的时候，优先选择范围小，精度高的方法，因此，它自动重载了char[]这个方法。\n\n通过以上，发现String.valueOf()方法是有可能出现null的。在使用时需要注意。\n\n',NULL,'http://localhost:8080/MyBoke/resources/imgs/contentImg/201606032146402.jpg',NULL,NULL,NULL,'2016-06-03 21:46:44','2016-06-03 21:46:44','java',1,0,1,0,0,1,1,0,0,NULL,NULL,NULL,NULL,NULL),(64,1,'king','/resources/imgs/header_pic/header_pic.jpg','冒泡排序 & 选择排序 & 插入排序 & 希尔排序 JavaScript 实现',NULL,'之前用 JavaScript 写过 快速排序 和 归并排序，本文聊聊四个基础排序算法。（本文默认排序结果都是从小到大）','冒泡排序每次循环结束会将最大的元素 \"冒泡\" 到最后一位。\n以 [1, 5, 2, 4, 3] 为例，O(n^2) 的复杂度，总共外层循环 5 次，第一次循环结束后的结果是 [1, 2, 4, 3, 5]。 首先是 1 和 5 比较，1 &lt;=5，不交换位置，然后 5 和 2 比较，5 &gt; 2，交换位置，数组变为 [1, 2, 5, 4, 3]，然后 5 和 4 比较，交换位置，数组变为 [1, 2, 4, 5, 3]，最后 5 和 3 比较，交换位置，数组为 [1, 2, 4, 3, 5]，这个时候最大的元素 5 已经到了最后，整个交换过程中大的元素就好像 \"冒泡\" 一样冒出来。然后 [1, 2, 4, 3] 再进行同样操作，以此类推。\n冒泡排序看起来无论最好情况还是最坏情况，复杂度一样，都是 O(n^2)。\n选择排序每次循环会找到最值元素的下标，然后将该元素交换到最前面。所以选择元素每次循环交换一次，不会像冒泡一样多次交换。\n还是以 [1, 5, 2, 4, 3] 为例，第一次循环比较，默认最值下标为 0，最值为 1，接着分别和 5，2，4，3 比较，ok 比完，最值的下标还是 0，那么就不交换（也可以看做 array[0] 和 array[0] 交换）。接着进行第二轮，是为 [5, 2, 4, 3] 进行循环，以此类推。\n和冒泡相比，选择排序也是无论好坏情况，复杂度都是 O(n^2)，而效率应该比冒泡稍微好点，毕竟交换次数少了。\n插入排序会比前面两种排序算法高效。它将数组分成 \"已排序\" 和 \"未排序\" 两部分，一开始的时候，\"已排序\" 的部分只有一个元素，然后将它后面一个元素从 \"未排序\" 部分插入 \"已排序\" 部分，从而 \"已排序\" 部分增加一个元素，\"未排序\" 部分减少一个元素。以此类推，完成全部排序。（摘自阮老师的博文 <a href=\"http://javascript.ruanyifeng.com/library/sorting.html\" class=\"uri\" style=\"color: rgb(0, 51, 102); border-bottom-style: dashed; border-bottom-width: 1px;\" _href=\"http://javascript.ruanyifeng.com/library/sorting.html\">http://javascript.ruanyifeng.com/library/sorting.html）\n还是以 [1, 5, 2, 4, 3] 为例，外层还是需要循环 5 次，假设循环到第三次，到 2 这个元素，前面已经有序，是为 [1, 5]，我们要将 2 插入，首先比较 5 和 2，交换，此时数组前三项为 [1, 2, 5]，再比较 1 和 2，ok，不用交换了，有序了，比较结束。再看 4，第一次比较后，交换，数组为 [1, 2, 4, 5]，然后 4 和 2 比较，ok，有序了，不用继续比了，那么 2 就不用和 1 比较了，这样就大大节省了相邻元素两两比较的次数。\n和前两者相比，插入排序能减少比较次数，当然最坏情况下还是 O(n^2)，但是和选择排序相比，可能会多交换次数。当然，真实生产环境中不可能用这三种排序方法，毕竟效率太低！不过一定要比较效率的话，我觉得是 插入排序 &gt; 选择排序 &gt; 冒泡排序！\n\n希尔排序是选择排序的升级版，可以说是分组插入排序，据说复杂度达到 O(n^1.2)。\n希尔排序是基于插入排序的以下两点性质而提出改进方法的：\n插入排序在对几乎已经排好序的数据操作时， 效率高， 即可以达到线性排序的效率但插入排序一般来说是低效的， 因为插入排序每次只能将数据移动一位\n它是怎么排序的呢？我们设定一个变量叫做 gap，gap 小于数组长度，对于数组，我们将距离 gap 的元素划分为一组，每组进行插入排序，gap 不断变小，最后减为 1，即完成希尔排序。\ngap 如何取值？有个简单一点的方法，第一次取值数组长度一半，然后再一半，再一半，最后为 1。当然如果要求更高效率，可以深入研究下 gap 的取值。至于希尔排序为什么效率会比普通的插入排序高，这点不在本文探讨范围之内（其实是我不知道），有兴趣的可以查阅相关资料。\n\n\n\n\n\n',NULL,'http://localhost:8080/MyBoke/resources/imgs/contentImg/201606032212194.jpg',NULL,NULL,NULL,'2016-06-03 22:12:26','2016-06-03 22:12:26','排序',1,0,1,0,0,1,1,0,0,NULL,NULL,NULL,NULL,NULL),(65,1,'king','/resources/imgs/header_pic/header_pic.jpg','java线程常见面试题',NULL,'java线程常见面试题','1、什么是线程？\n线程是操作系统能够进行运算调度的最小单位，它被包含在进程之中，是进程中的实际运作单位。程序员可以通过它进行多处理器编程，你可以使用多线程对运算密集型任务提速。比如，如果一个线程完成一个任务要100毫秒，那么用十个线程完成改任务只需10毫秒。Java在语言层面对多线程提供了卓越的支持，它也是一个很好的卖点。\n2、线程和进程有什么区别？\n线程是进程的子集，一个进程可以有很多线程，每条线程并行执行不同的任务。不同的进程使用不同的内存空间，而所有的线程共享一片相同的内存空间。别把它和栈内存搞混，每个线程都拥有单独的栈内存用来存储本地数据。\n3、如何在Java中实现线程？\n在语言层面有两种方式。java.lang.Thread 类的实例就是一个线程但是它需要调用java.lang.Runnable接口来执行，由于线程类本身就是调用的Runnable接口所以你可以继承java.lang.Thread 类或者直接调用Runnable接口来重写run()方法实现线程。\n4、用Runnable还是Thread？\n这个问题是上题的后续，大家都知道我们可以通过继承Thread类或者调用Runnable接口来实现线程，问题是，那个方法更好呢？什么情况下使用它？这个问题很容易回答，如果你知道Java不支持类的多重继承，但允许你调用多个接口。所以如果你要继承其他类，当然是调用Runnable接口好了。\n5、Thread 类中的start() 和 run() 方法有什么区别？\n这个问题经常被问到，但还是能从此区分出面试者对Java线程模型的理解程度。start()方法被用来启动新创建的线程，而且start()内部调用了run()方法，这和直接调用run()方法的效果不一样。当你调用run()方法的时候，只会是在原来的线程中调用，没有新的线程启动，start()方法才会启动新线程。\n6、Java中Runnable和Callable有什么不同？\nRunnable和Callable都代表那些要在不同的线程中执行的任务。Runnable从JDK1.0开始就有了，Callable是在JDK1.5增加的。它们的主要区别是Callable的 call() 方法可以返回值和抛出异常，而Runnable的run()方法没有这些功能。Callable可以返回装载有计算结果的Future对象。\n7、Java中CyclicBarrier 和 CountDownLatch有什么不同？\nCyclicBarrier 和 CountDownLatch 都可以用来让一组线程等待其它线程。与 CyclicBarrier 不同的是，CountdownLatch 不能重新使用。\n8、Java内存模型是什么？\nJava内存模型规定和指引Java程序在不同的内存架构、CPU和操作系统间有确定性地行为。它在多线程的情况下尤其重要。Java内存模型对一个线程所做的变动能被其它线程可见提供了保证，它们之间是先行发生关系。这个关系定义了一些规则让程序员在并发编程时思路更清晰。比如，先行发生关系确保了：\n线程内的代码能够按先后顺序执行，这被称为程序次序规则。对于同一个锁，一个解锁操作一定要发生在时间上后发生的另一个锁定操作之前，也叫做管程锁定规则。前一个对volatile的写操作在后一个volatile的读操作之前，也叫volatile变量规则。一个线程内的任何操作必需在这个线程的start()调用之后，也叫作线程启动规则。一个线程的所有操作都会在线程终止之前，线程终止规则。一个对象的终结操作必需在这个对象构造完成之后，也叫对象终结规则。可传递性\n10、Java中的volatile 变量是什么？\nvolatile是一个特殊的修饰符，只有成员变量才能使用它。在Java并发程序缺少同步类的情况下，多线程对成员变量的操作对其它线程是透明的。volatile变量可以保证下一个读取操作会在前一个写操作之后发生，就是上一题的volatile变量规则。\n11、什么是线程安全？Vector是一个线程安全类吗？\n如果你的代码所在的进程中有多个线程在同时运行，而这些线程可能会同时运行这段代码。如果每次运行结果和单线程运行的结果是一样的，而且其他的变量的值也和预期的是一样的，就是线程安全的。一个线程安全的计数器类的同一个实例对象在被多个线程使用的情况下也不会出现计算失误。很显然你可以将集合类分成两组，线程安全和非线程安全的。Vector 是用同步方法来实现线程安全的, 而和它相似的ArrayList不是线程安全的。\n12、Java中什么是竞态条件？ 举个例子说明。\n竞态条件会导致程序在并发情况下出现一些bugs。多线程对一些资源的竞争的时候就会产生竞态条件，如果首先要执行的程序竞争失败排到后面执行了，那么整个程序就会出现一些不确定的bugs。这种bugs很难发现而且会重复出现，因为线程间的随机竞争。一个例子就是无序处理。\n13、Java中如何停止一个线程？\nJava提供了很丰富的API但没有为停止线程提供API。JDK 1.0本来有一些像stop(), suspend() 和 resume()的控制方法但是由于潜在的死锁威胁因此在后续的JDK版本中他们被弃用了，之后Java API的设计者就没有提供一个兼容且线程安全的方法来停止一个线程。当run() 或者 call() 方法执行完的时候线程会自动结束,如果要手动结束一个线程，你可以用volatile 布尔变量来退出run()方法的循环或者是取消任务来中断线程。\n14、一个线程运行时发生异常会怎样？\n这是我在一次面试中遇到的一个很刁钻的Java面试题, 简单的说，如果异常没有被捕获该线程将会停止执行。Thread.UncaughtExceptionHandler是用于处理未捕获异常造成线程突然中断情况的一个内嵌接口。当一个未捕获异常将造成线程中断的时候JVM会使用Thread.getUncaughtExceptionHandler()来查询线程的UncaughtExceptionHandler并将线程和异常作为参数传递给handler的uncaughtException()方法进行处理。\n15、如何在两个线程间共享数据？\n你可以通过共享对象来实现这个目的，或者是使用像阻塞队列这样并发的数据结构。这篇教程《Java线程间通信》(涉及到在两个线程间共享对象)用wait和notify方法实现了生产者消费者模型。\n16、Java中notify 和 notifyAll有什么区别？\n这又是一个刁钻的问题，因为多线程可以等待单监控锁，Java API 的设计人员提供了一些方法当等待条件改变的时候通知它们，但是这些方法没有完全实现。notify()方法不能唤醒某个具体的线程，所以只有一个线程在等待的时候它才有用武之地。而notifyAll()唤醒所有线程并允许他们争夺锁确保了至少有一个线程能继续运行。\n17、为什么wait, notify 和 notifyAll这些方法不在thread类里面？\n这是个设计相关的问题，它考察的是面试者对现有系统和一些普遍存在但看起来不合理的事物的看法。回答这些问题的时候，你要说明为什么把这些方法放在Object类里是有意义的，还有不把它放在Thread类里的原因。一个很明显的原因是JAVA提供的锁是对象级的而不是线程级的，每个对象都有锁，通过线程获得。如果线程需要等待某些锁那么调用对象中的wait()方法就有意义了。如果wait()方法定义在Thread类中，线程正在等待的是哪个锁就不明显了。简单的说，由于wait，notify和notifyAll都是锁级别的操作，所以把他们定义在Object类中因为锁属于对象。\n18、什么是ThreadLocal变量？\nThreadLocal是Java里一种特殊的变量。每个线程都有一个ThreadLocal就是每个线程都拥有了自己独立的一个变量，竞争条件被彻底消除了。它是为创建代价高昂的对象获取线程安全的好方法，比如你可以用ThreadLocal让SimpleDateFormat变成线程安全的，因为那个类创建代价高昂且每次调用都需要创建不同的实例所以不值得在局部范围使用它，如果为每个线程提供一个自己独有的变量拷贝，将大大提高效率。首先，通过复用减少了代价高昂的对象的创建个数。其次，你在没有使用高代价的同步或者不变性的情况下获得了线程安全。线程局部变量的另一个不错的例子是ThreadLocalRandom类，它在多线程环境中减少了创建代价高昂的Random对象的个数。\n19、什么是FutureTask？\n在Java并发程序中FutureTask表示一个可以取消的异步运算。它有启动和取消运算、查询运算是否完成和取回运算结果等方法。只有当运算完成的时候结果才能取回，如果运算尚未完成get方法将会阻塞。一个FutureTask对象可以对调用了Callable和Runnable的对象进行包装，由于FutureTask也是调用了Runnable接口所以它可以提交给Executor来执行。\n20、Java中interrupted 和 isInterruptedd方法的区别？\ninterrupted() 和 isInterrupted()的主要区别是前者会将中断状态清除而后者不会。Java多线程的中断机制是用内部标识来实现的，调用Thread.interrupt()来中断一个线程就会设置中断标识为true。当中断线程调用静态方法Thread.interrupted()来检查中断状态时，中断状态会被清零。而非静态方法isInterrupted()用来查询其它线程的中断状态且不会改变中断状态标识。简单的说就是任何抛出InterruptedException异常的方法都会将中断状态清零。无论如何，一个线程的中断状态有有可能被其它线程调用中断来改变。\n21、为什么wait和notify方法要在同步块中调用？\n主要是因为Java API强制要求这样做，如果你不这么做，你的代码会抛出IllegalMonitorStateException异常。还有一个原因是为了避免wait和notify之间产生竞态条件。\n22、为什么你应该在循环中检查等待条件?\n处于等待状态的线程可能会收到错误警报和伪唤醒，如果不在循环中检查等待条件，程序就会在没有满足结束条件的情况下退出。因此，当一个等待线程醒来时，不能认为它原来的等待状态仍然是有效的，在notify()方法调用之后和等待线程醒来之前这段时间它可能会改变。这就是在循环中使用wait()方法效果更好的原因，你可以在Eclipse中创建模板调用wait和notify试一试。如果你想了解更多关于这个问题的内容，我推荐你阅读《Effective Java》这本书中的线程和同步章节。\n23、Java中的同步集合与并发集合有什么区别？\n同步集合与并发集合都为多线程和并发提供了合适的线程安全的集合，不过并发集合的可扩展性更高。在Java1.5之前程序员们只有同步集合来用且在多线程并发的时候会导致争用，阻碍了系统的扩展性。Java5介绍了并发集合像ConcurrentHashMap，不仅提供线程安全还用锁分离和内部分区等现代技术提高了可扩展性。更多内容详见答案。\n24、Java中堆和栈有什么不同？\n为什么把这个问题归类在多线程和并发面试题里？因为栈是一块和线程紧密相关的内存区域。每个线程都有自己的栈内存，用于存储本地变量，方法参数和栈调用，一个线程中存储的变量对其它线程是不可见的。而堆是所有线程共享的一片公用内存区域。对象都在堆里创建，为了提升效率线程会从堆中弄一个缓存到自己的栈，如果多个线程使用该变量就可能引发问题，这时volatile 变量就可以发挥作用了，它要求线程从主存中读取变量的值。\n25、什么是线程池？ 为什么要使用它？\n创建线程要花费昂贵的资源和时间，如果任务来了才创建线程那么响应时间会变长，而且一个进程能创建的线程数有限。为了避免这些问题，在程序启动的时候就创建若干线程来响应处理，它们被称为线程池，里面的线程叫工作线程。从JDK1.5开始，Java API提供了Executor框架让你可以创建不同的线程池。比如单线程池，每次处理一个任务；数目固定的线程池或者是缓存线程池（一个适合很多生存期短的任务的程序的可扩展线程池）。\n26、如何写代码来解决生产者消费者问题？\n在现实中你解决的许多线程问题都属于生产者消费者模型，就是一个线程生产任务供其它线程进行消费，你必须知道怎么进行线程间通信来解决这个问题。比较低级的办法是用wait和notify来解决这个问题，比较赞的办法是用Semaphore 或者 BlockingQueue来实现生产者消费者模型。\n27、如何避免死锁？\nJava多线程中的死锁 死锁是指两个或两个以上的进程在执行过程中，因争夺资源而造成的一种互相等待的现象，若无外力作用，它们都将无法推进下去。这是一个严重的问题，因为死锁会让你的程序挂起无法完成任务，死锁的发生必须满足以下四个条件：\n互斥条件：一个资源每次只能被一个进程使用。请求与保持条件：一个进程因请求资源而阻塞时，对已获得的资源保持不放。不剥夺条件：进程已获得的资源，在末使用完之前，不能强行剥夺。循环等待条件：若干进程之间形成一种头尾相接的循环等待资源关系。\n避免死锁最简单的方法就是阻止循环等待条件，将系统中所有的资源设置标志位、排序，规定所有的进程申请资源必须以一定的顺序（升序或降序）做操作来避免死锁。\n28、Java中活锁和死锁有什么区别？\n这是上题的扩展，活锁和死锁类似，不同之处在于处于活锁的线程或进程的状态是不断改变的，活锁可以认为是一种特殊的饥饿。一个现实的活锁例子是两个人在狭小的走廊碰到，两个人都试着避让对方好让彼此通过，但是因为避让的方向都一样导致最后谁都不能通过走廊。简单的说就是，活锁和死锁的主要区别是前者进程的状态可以改变但是却不能继续执行。\n29、怎么检测一个线程是否拥有锁？\n我一直不知道我们竟然可以检测一个线程是否拥有锁，直到我参加了一次电话面试。在java.lang.Thread中有一个方法叫holdsLock()，它返回true如果当且仅当当前线程拥有某个具体对象的锁。\n30、你如何在Java中获取线程堆栈？\n对于不同的操作系统，有多种方法来获得Java进程的线程堆栈。当你获取线程堆栈时，JVM会把所有线程的状态存到日志文件或者输出到控制台。在Windows你可以使用Ctrl + Break组合键来获取线程堆栈，Linux下用kill -3命令。你也可以用jstack这个工具来获取，它对线程id进行操作，你可以用jps这个工具找到id。\n31、JVM中哪个参数是用来控制线程的栈堆栈小的？\n这个问题很简单， -Xss参数用来控制线程的堆栈大小。你可以查看JVM配置列表来了解这个参数的更多信息。\n32、Java中synchronized 和 ReentrantLock 有什么不同？\nJava在过去很长一段时间只能通过synchronized关键字来实现互斥，它有一些缺点。比如你不能扩展锁之外的方法或者块边界，尝试获取锁时不能中途取消等。Java 5 通过Lock接口提供了更复杂的控制来解决这些问题。 ReentrantLock 类实现了 Lock，它拥有与 synchronized 相同的并发性和内存语义且它还具有可扩展性。\n33、有三个线程T1，T2，T3，怎么确保它们按顺序执行？\n在多线程中有多种方法让线程按特定顺序执行，你可以用线程类的join()方法在一个线程中启动另一个线程，另外一个线程完成该线程继续执行。为了确保三个线程的顺序你应该先启动最后一个(T3调用T2，T2调用T1)，这样T1就会先完成而T3最后完成。\n34、Thread类中的yield方法有什么作用？\nYield方法可以暂停当前正在执行的线程对象，让其它有相同优先级的线程执行。它是一个静态方法而且只保证当前线程放弃CPU占用而不能保证使其它线程一定能占用CPU，执行yield()的线程有可能在进入到暂停状态后马上又被执行。\n35、Java中ConcurrentHashMap的并发度是什么？\nConcurrentHashMap把实际map划分成若干部分来实现它的可扩展性和线程安全。这种划分是使用并发度获得的，它是ConcurrentHashMap类构造函数的一个可选参数，默认值为16，这样在多线程情况下就能避免争用。\n36、Java中Semaphore是什么？\nJava中的Semaphore是一种新的同步类，它是一个计数信号。从概念上讲，从概念上讲，信号量维护了一个许可集合。如有必要，在许可可用前会阻塞每一个 acquire()，然后再获取该许可。每个 release()添加一个许可，从而可能释放一个正在阻塞的获取者。但是，不使用实际的许可对象，Semaphore只对可用许可的号码进行计数，并采取相应的行动。信号量常常用于多线程的代码中，比如数据库连接池。\n37、如果你提交任务时，线程池队列已满。会时发会生什么？\n这个问题问得很狡猾，许多程序员会认为该任务会阻塞直到线程池队列有空位。事实上如果一个任务不能被调度执行那么ThreadPoolExecutor’s submit()方法将会抛出一个RejectedExecutionException异常。\n38、Java线程池中submit() 和 execute()方法有什么区别？\n两个方法都可以向线程池提交任务，execute()方法的返回类型是void，它定义在Executor接口中, 而submit()方法可以返回持有计算结果的Future对象，它定义在ExecutorService接口中，它扩展了Executor接口，其它线程池类像ThreadPoolExecutor和ScheduledThreadPoolExecutor都有这些方法。\n39、 什么是阻塞式方法？\n阻塞式方法是指程序会一直等待该方法完成期间不做其他事情，ServerSocket的accept()方法就是一直等待客户端连接。这里的阻塞是指调用结果返回之前，当前线程会被挂起，直到得到结果之后才会返回。此外，还有异步和非阻塞式方法在任务完成前就返回。\n40、Swing是线程安全的吗？ 为什么？\n你可以很肯定的给出回答，Swing不是线程安全的，但是你应该解释这么回答的原因即便面试官没有问你为什么。当我们说swing不是线程安全的常常提到它的组件，这些组件不能在多线程中进行修改，所有对GUI组件的更新都要在AWT线程中完成，而Swing提供了同步和异步两种回调方法来进行更新。\n41、Java中invokeAndWait 和 invokeLater有什么区别？\n这两个方法是Swing API 提供给Java开发者用来从当前线程而不是事件派发线程更新GUI组件用的。InvokeAndWait()同步更新GUI组件，比如一个进度条，一旦进度更新了，进度条也要做出相应改变。如果进度被多个线程跟踪，那么就调用invokeAndWait()方法请求事件派发线程对组件进行相应更新。而invokeLater()方法是异步调用更新组件的。\n42、Swing API中那些方法是线程安全的？\n这个问题又提到了swing和线程安全，虽然组件不是线程安全的但是有一些方法是可以被多线程安全调用的，比如repaint(), revalidate()。 JTextComponent的setText()方法和JTextArea的insert() 和 append() 方法也是线程安全的。\n43、如何在Java中创建Immutable对象？\n这个问题看起来和多线程没什么关系， 但不变性有助于简化已经很复杂的并发程序。Immutable对象可以在没有同步的情况下共享，降低了对该对象进行并发访问时的同步化开销。可是Java没有@Immutable这个注解符，要创建不可变类，要实现下面几个步骤：通过构造方法初始化所有成员、对变量不要提供setter方法、将所有的成员声明为私有的，这样就不允许直接访问这些成员、在getter方法中，不要直接返回对象本身，而是克隆对象，并返回对象的拷贝。\n44、Java中的ReadWriteLock是什么？\n一般而言，读写锁是用来提升并发程序性能的锁分离技术的成果。Java中的ReadWriteLock是Java 5 中新增的一个接口，一个ReadWriteLock维护一对关联的锁，一个用于只读操作一个用于写。在没有写线程的情况下一个读锁可能会同时被多个读线程持有。写锁是独占的，你可以使用JDK中的ReentrantReadWriteLock来实现这个规则，它最多支持65535个写锁和65535个读锁。\n45、多线程中的忙循环是什么?\n忙循环就是程序员用循环让一个线程等待，不像传统方法wait(), sleep() 或 yield() 它们都放弃了CPU控制，而忙循环不会放弃CPU，它就是在运行一个空循环。这么做的目的是为了保留CPU缓存，在多核系统中，一个等待线程醒来的时候可能会在另一个内核运行，这样会重建缓存。为了避免重建缓存和减少等待重建的时间就可以使用它了。\n46、volatile 变量和 atomic 变量有什么不同？\n这是个有趣的问题。首先，volatile 变量和 atomic 变量看起来很像，但功能却不一样。Volatile变量可以确保先行关系，即写操作会发生在后续的读操作之前, 但它并不能保证原子性。例如用volatile修饰count变量那么 count++ 操作就不是原子性的。而AtomicInteger类提供的atomic方法可以让这种操作具有原子性如getAndIncrement()方法会原子性的进行增量操作把当前值加一，其它数据类型和引用变量也可以进行相似操作。\n47、如果同步块内的线程抛出异常会发生什么？\n这个问题坑了很多Java程序员，若你能想到锁是否释放这条线索来回答还有点希望答对。无论你的同步块是正常还是异常退出的，里面的线程都会释放锁，所以对比锁接口我更喜欢同步块，因为它不用我花费精力去释放锁，该功能可以在finally block里释放锁实现。\n48、单例模式的双检锁是什么？\n这个问题在Java面试中经常被问到，但是面试官对回答此问题的满意度仅为50%。一半的人写不出双检锁还有一半的人说不出它的隐患和Java1.5是如何对它修正的。它其实是一个用来创建线程安全的单例的老方法，当单例实例第一次被创建时它试图用单个锁进行性能优化，但是由于太过于复杂在JDK1.4中它是失败的，我个人也不喜欢它。无论如何，即便你也不喜欢它但是还是要了解一下，因为它经常被问到\n49、如何在Java中创建线程安全的Singleton？\n这是上面那个问题的后续，如果你不喜欢双检锁而面试官问了创建Singleton类的替代方法，你可以利用JVM的类加载和静态变量初始化特征来创建Singleton实例，或者是利用枚举类型来创建Singleton，我很喜欢用这种方法。\n50、写出3条你遵循的多线程最佳实践\n这种问题我最喜欢了，我相信你在写并发代码来提升性能的时候也会遵循某些最佳实践。以下三条最佳实践我觉得大多数Java程序员都应该遵循：\n给你的线程起个有意义的名字。这样可以方便找bug或追踪。OrderProcessor, QuoteProcessor or TradeProcessor 这种名字比 Thread-1. Thread-2 and Thread-3 好多了，给线程起一个和它要完成的任务相关的名字，所有的主要框架甚至JDK都遵循这个最佳实践。避免锁定和缩小同步的范围。锁花费的代价高昂且上下文切换更耗费时间空间，试试最低限度的使用同步和锁，缩小临界区。因此相对于同步方法我更喜欢同步块，它给我拥有对锁的绝对控制权。多用同步类少用wait 和 notify。首先，CountDownLatch, Semaphore, CyclicBarrier 和 Exchanger 这些同步类简化了编码操作，而用wait和notify很难实现对复杂控制流的控制。其次，这些类是由最好的企业编写和维护在后续的JDK中它们还会不断优化和完善，使用这些更高等级的同步工具你的程序可以不费吹灰之力获得优化。多用并发集合少用同步集合。这是另外一个容易遵循且受益巨大的最佳实践，并发集合比同步集合的可扩展性更好，所以在并发编程时使用并发集合效果更好。如果下一次你需要用到map，你应该首先想到用ConcurrentHashMap。\n51、如何强制启动一个线程？\n这个问题就像是如何强制进行Java垃圾回收，目前还没有觉得方法，虽然你可以使用System.gc()来进行垃圾回收，但是不保证能成功。在Java里面没有办法强制启动一个线程，它是被线程调度器控制着且Java没有公布相关的API。\n52、Java中的fork join框架是什么？\nfork join框架是JDK7中出现的一款高效的工具，Java开发人员可以通过它充分利用现代服务器上的多处理器。它是专门为了那些可以递归划分成许多子模块设计的，目的是将所有可用的处理能力用来提升程序的性能。fork join框架一个巨大的优势是它使用了工作窃取算法，可以完成更多任务的工作线程可以从其它线程中窃取任务来执行。\n53、Java多线程中调用wait() 和 sleep()方法有什么不同？\nJava程序中wait 和 sleep都会造成某种形式的暂停，它们可以满足不同的需要。wait()方法用于线程间通信，如果等待条件为真且其它线程被唤醒时它会释放锁，而sleep()方法仅仅释放CPU资源或者让当前线程停止执行一段时间，但不会释放锁。\n\n\n',NULL,'http://localhost:8080/MyBoke/resources/imgs/contentImg/201606032218402.jpg',NULL,NULL,NULL,'2016-06-08 18:47:41','2016-06-08 18:47:41','线程面试题',1,0,1,0,3,1,1,2,6,NULL,NULL,NULL,NULL,NULL),(66,153,'xdj','/resources/imgs/header_pic/headerpic.jpg','把一个表单设计到极致是怎样一种体验？',NULL,'把一个表单设计到极致是怎样一种体验？','对于表单大家可能都不陌生，我们每天都会接触到各式各样的表单，比如：注册登录、填写信息、发布信息、等等，表单是页面设计中十分重要的组成部分，也是用户体验设计中很容易被我们忽视的一块区域，复杂繁琐的表单设计很容易造成用户中途放弃操作而流失掉。那么如何设计一款有着不错用户体验的表单呢？针对这一问题，本文列举移动端和PC端表单设计的几种案例和方法，希望对大家能够有所帮助。\n\n简单清晰的信息层级\n\n面对复杂的表单信息，首先需要对其进行必要的信息排序和整理归纳，有意识的利用线条和颜色对不同类型的表单进行区分，从而降低复杂表单对用户操作可能带来的麻烦，使用户不排斥我们的产品，愿意去输入我们想得到的信息，快速准确的进入下一步操作。比如在用户注册页面，仅保留必要信息的录入框，剔除掉其余非必要的信息。其他信息可以在使用过程中引导用户完善，有效简化了用户的注册流程，降低了用户的使用负担。下图是两种注册表单，设想一下你是用户，你更喜欢哪一种呢？我想大多数同学肯定会和我一样，选择左边的表单。左图中的表单只需要用户填写必要的信息即可完成注册，而右图中的表单则需要用户填写出生年月、身份证号码这些非必要的注册信息，增加了用户的操作时间，而且身份证号码对于用户来说涉及到了相关隐私，会给用户带来安全性的担忧。表单的填写可以根据不同的维度进行分组，从而提高注册效率。\n\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/9/6/7/641769.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n\nPC端注册页面\n\n用户没有我们想的那么勤奋\n\n很多时候，我们总会将自己假想成为用户，把用户想象的过于完美，但现实却与我们想象的截然不同，用户并没有我们想象的那么勤奋，因此就需要在我们的界面设计上下足功夫。要知道，用户在使用我们的产品时，一定是遇到了某些问题或想做某些事，需要我们做的就是，帮助用户快速的、有效的、不出错的完成想要完成的事。举个栗子，我们常用的手机充值界面。左图在充值时输入号码后会自动弹出售价，而右图则需要手动填写充值数量。很显然，这种条件下让用户手动输入，无疑是给用户制造了麻烦，用户很可能在中途就放弃了充值，而左图中为用户提供了多种充值额度的选择，帮助用户节省时间，1秒钟的等待都可能造成用户流失，所以在这个问题上就要做到能够让用户选择完成的就不要让用户去输入完成。\n\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/0/7/7/641770.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n\n移动端话费充值页面\n\n为用户提供必要的帮助\n\n在填写表单时，大多数用户会很顺利的完成填写，但是还会有一小部分用户，在填写中出现错误，这就需要我们要在必要的时候，及时的出现一些提示性的信息，指导并帮助用户顺利的完成填写，目前最常见的提示方式我归纳为以下两种分别是直接展现形式和触发展现形式。直接展现形式是指用户不需要进行任何操作，提示信息自动出现在相关的区域内，目前最常见的就是出现在输入框的内部或右侧。例如我们常用的登录页面，在为输入用户名时会提示你请输入邮箱/用户名/已验证手机的提示信息，帮助用户尽快完成操作。触发展现形式是指用户触发操作后，展现出相关提示内容，提示用户该如何进行下一步操作、判断用户当前的操作是否正确。\n\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/3/7/7/641773.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n\n提示信息\n\n最后\n\n设计师应该是一个有灵魂的职业，我们为世界的一切变得更美好而生。设计师的灵魂在于创造力，而创造力源自生活的方方面面。\n\n好了，就写这么多吧，希望能够对各位小伙伴有所帮助，表单设计虽然在页面设计中占得比例不是那么大，但我认为，它的用户体验好与坏能够直接导致用户的去留，我们做任何设计都是一样，设计出来的内容是帮助用户解决问题，而不是为用户制造麻烦，表单虽小，但我们在平时的设计中也要重视起来，把不可能变成可能，把平凡做到极致这才是一个设计师应该具有的职业精神。由于自己的能力水平还比较有限，如果在文中出现哪些不妥的地方，还请各位老师及时的批评指正。\n\n\n<img class=\"fr-fin fr-dib\" alt=\"Image title\" src=\"http://img.ui.cn/data/file/2/9/9/643992.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin: auto; display: block; overflow: auto; z-index: 1; position: relative; float: none; padding-top: 10px; padding-bottom: 10px;\">\n\n我的微信公众号，有兴趣的可以关注一下。\n\n',NULL,'http://localhost:8080/MyBoke/resources/imgs/contentImg/201606081220021.jpg',NULL,NULL,NULL,'2016-06-15 22:22:44','2016-06-08 18:56:16','经验观点',1,0,1,0,17,1,1,4,6,NULL,NULL,NULL,NULL,NULL),(67,153,'xdj','/resources/imgs/header_pic/headerpic.jpg','设计师如何设计作品集',NULL,'设计师做好的作品集可以大大提高面试通过率，而很多人依然用错误的方法在做作品集。竹子指导了一个设计师通过一周时间的修改获得了更好的面试机会。','少喝点鸡汤，多一点实干\n\n平时的一点一滴，画的每一张图、做的每一个项目、写的每一篇文章、看的每一本书、拍的每一张照片、走过的每一个地方，那些才是你的履历。而简历，只不过是把这个过程中符合岗位要求的部分拿出来整理一下罢了。所以我能教你的只能是把你已经有的东西如何更好的呈现。\n\n之前写过一篇《如何寻找靠谱的领导》，朋友圈里大家传播的很快，大家纷纷表示我也遇到类似的坑啊。某同学说我很喜欢你的文章，对我非常有用，可是我依然不知道如何改进我自己。\n\n这位同学很聪明，找到我的邮箱直接发简历和作品给我，说竹子你可以帮忙看看嘛？有没有哪需要改进的。为了鼓励她的机智，我挑了她的简历来做一次设计师简历点评，大家看看有没有可以借鉴的。\n\n你需要了解HR的心理 \n根据之前某权威设计网站的统计数据，设计师大多数就业方向不是设计公司，而是做产品的企业公司。所以我这里点评都是针对企业公司。这类公司最先接触到你的简历的就是HR（人事部门），而你与这个公司第一次亲密接触就是通过邮件发生的。你的简历首先必须通过邮件形式传递到HR那里，经过HR的审核才有可能被推荐至部门负责人手上。\n\n设计公司的员工一般百人之内的规模，HR招聘的职位种类有限，也不会有很多应聘的邮件，你的应聘邮件一定会被她看到。\n\n而企业公司的HR就不一样了，HR部门收到的简历和雪片一样，每天面对那么多的简历，而且招聘的岗位种类也非常多，所以你必须分析他们的心理，知道HR的想法，做他们喜欢的简历。\n\n阿里巴巴的HR部门就有一票否决权哦，所以去阿里的同学更是要仔细研究面试HR的心理，不过这个不在我们这次话题范围。\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/2/1/6/641612.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n修改点1：因为是找我点评的，所以内容不具有参考价值，不过漏了一个重要信息，你是谁？这里一定要写清楚，我相信每天人事mm的邮箱邮件很多，必须让她从一堆邮件中快速找到你，所以在正文和邮件标题写清楚我是谁。\n邮件标题标准格式：UI设计师竹子简历+作品\n\n修改点2：这里非常不错，写清楚了所有的个人信息，有人说我简历里不是写了吗？还是那个道理，方便人事mm，也许差不多简历，让你的个人信息更容易被看见，而不是在一堆简历里慢慢找到。\n\n修改点3：这位同学附件只发了一个PPT作品给我，这里漏了一个Word格式的简历。有同学问了，设计师找工作作品集还不够吗？恩，你面试的公司大多不是设计公司，决定你的简历能不能到用人部门的是HR，他们无法评价你的专业能力，他们只想知道你能不能干活，能干多少钱的活儿，怎么便宜的招到你，如此而已。所以word简历是方便让HR快速了解你的情况的。下面这个简历就是非常标准的附件。\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/3/1/6/641613.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n另外一些规范化的公司，word简历也是走招聘流程重要一环。楼下这位同学这样的简历就随意了，不仅没有作品集也没有word简历，直接丢个链接给我，而且还是一个相对链接，我点了都打不开的。\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/9/7/8/642879.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n修改点4：作品集的大小控制的非常好，控制在30MB下。曾经看过一些同学的作品集，动辄上百兆，这样的简历我都不想下。你要知道很多公司的网络状况没那么好，特别是HR部门每天面对很多简历的时候。你的简历缺乏word而作品集又非常巨大的时候，说不定就被Pass了。\n\n\n\n作品集展现形式\n我看过设计师作品集的形式五花八门，各种千奇百怪的展现形式。我觉得可能是设计师想象力比较丰富吧。\n\n\n典型案例1：一堆神秘文件夹\n设计简历作品就是一堆文件夹。这样的作品我看几眼直接扔掉。因为对待自己的作品都这样随意，你肯定还不算合格的设计师。而且我相信面试官也没有耐心一个个点击你的文件夹看你们藏了什么。\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/4/8/8/642884.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n\n典型案例2：多如牛毛的附件\n第一次看到这个附件的时候，我想打人，同学你有没有想过面试官一个个点击下载你这些文件会如何感想。这不仅是没有经过整理的作品集，而且是有虐待倾向。\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/5/8/8/642885.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n典型案例3：超长图片\n不知道什么时候UI设计师挺流行这样做简历的，一个非常超级长的图，我猜是移动App展示挺喜欢用这种形式，一整张图作品都堆在上面，不过有一个非常致命缺点。你所有的个人信息都是图片形式，我想粘贴复制任何个人信息都不行。另外HR的电脑屏幕都不怎么大，看到这样的超级长图片是非常崩溃的。\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/6/8/8/642886.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n典型案例4：一堆图片\n这位同学是花了一些心思整理过自己的作品的。但是因为每张图片大小不一样，用看图软件查看图片，每张图片与图片之间的切换体验，感觉是突兀的。\n\n我觉得PPT是一个靠谱的作品展现形式。PPT每张图片大小一样，展示体验比较好。而且HR电脑上可能没有PDF阅读器，但office可是必备的办公软件，PPT也方便HR查看。\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/7/8/8/642887.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n设计师是什么？是一个用心创造美的群体。你必须用最短的时间展现出你表现美的能力，\n同时照顾到观看者的体验。所以做PPT作品集可不是直接把一堆图片直接丢进PPT，然后就算做完了。\n\n作品集是一份进行精心编排的主题。这句话希望所有的设计师记住。\n\n我是如何修改PPT作品的\n好了说了这么多，我们来看看这位同学的作品集，由于隐私我抹去了一些信息。空谈一堆理论不如说说怎么修改更实在。\n\n\n首页\n这里是第一眼印象，抓人眼球非常重要。我必须赞一下粉丝，这是我前几天才发布的课程 《如何运用渐变，快速提升设计格调》，立即用在了自己的设计上。设计就应该这样活学活用，勤于思考。而不是我教你画一个渐变的方法，你只是画一个渐变。设计我只能教方法，但你可以选择各种发散应用。从这点我判断她是一个非常有潜力的新人。\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/8/8/8/642888.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n\n\n个人介绍页\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/1/9/8/642891.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n修改点1：作者本色出境，干净利落。不过我劝大多数设计师不要这么设计。第一这个很拼本人颜值啊。第二你如果穿着不得体，很容易招人反感，黑色是我目前觉得最适合设计师上镜的衣着。第三你需要一个会拍照的朋友。这样拍照很死板，可以试着把不用正面，来一个阳光的笑容，侧面手指着右边的个人信息。这样使图片和文字联系起来了。这样的细节显得你是精心编排过的。\n\n\n修改点2：这页必须交代清楚个人信息。比如姓名、出生年月、学校专业、联系电话、邮箱，还有简单的工作经验。居住地可以去掉，除非你准备异地找工作。个人信息如果能附上QQ会更好，方便一些不愿意直接电话联系你的用人单位，先线上沟通一下双方意向。\n当然我希望文字尽可能对齐，直接修改为：姓名、学校、电话、邮箱、经验。这样标题文字可以对齐了。\n\n\n修改点3：这个标题字体可以修改。现在的非衬线字体略显粗矿。可以修改使用衬线体。另外那根粗粗的黑线也可以去掉了。因为字体大小已经有了区分，通过留白已经可以拉开距离了。高手是通过留白的技巧来区分板块的。\n\n\n没有用的技能球\n说到个人简介部分，吐槽一下这几年经常能看到一种设计形式，把自己会的各种软件列出来，并根据自己熟练程度罗列个百分比数字。这种设计形式我命名为技能球，因为挺像游戏里的各种人物属性技能球一样。\n但是这种设计形式有啥用处，比如下图PS到底多熟练算90%？每个人理解都不一样，我做了很多年设计，我感觉我只会PS一点点功能。还有DW掌握了40%你到底是会还是不会了？是只会打开软件吗？\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/2/9/8/642892.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n\n第一页到第四页\n我们来总体看下这前四页，好像没啥问题，我告诉你问题在哪。我刚才说过作品集就是一份进行精心编排的主题，第一页那么绚丽的渐变，后面完全没了呼应，这等于我前面唱了一首流行歌曲，突然后面就是轻音乐，设计上完全断了联系。\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/8/9/8/642898.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n那么如何呼应了？运用设计元素的重复即可。不明白？我给你看一个精彩的设计呼应。这位设计师的简历，首页内页以及结尾使用的背景以及辅助元素高度统一。这就是元素的呼应，设计的编排。\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/9/9/8/642899.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/0/0/9/642900.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/1/0/9/642901.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n\n内页展示A\n这应该是一个App的设计展示。这是一个很失败的展示，没有任何设计说明。套上了几个已经烂大街的模板。并没有App原有的界面得到很好的展示。问题很多，所以我就不具体说每一页如何修改。\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/2/0/9/642902.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n修改点1：头图就是给人第一印象的，这个左右排版非常的刻板，可以尝试着左边是最终原图，右边是线稿，类似下图一半实图，一般虚图。通过蒙层渐变来过渡。非常的有设计格调，而且又能体现你手绘的过程。\n\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/3/0/9/642903.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n修改点2：首先一个App展示你应该从logo说起，如何个思考设计这logo的，因为用户接触的就是这个logo，比如通过调研，或者各种研究。得出了这个心这个图形适合表达这个产品的立意。然后市面上的心形太多了，你总要做一点创新吧，把这个过程用图形表达出来。\n把这个立意的过程，比如白板上的关键词头脑风暴，铅笔手绘的草稿啊，整理出来一个高大上的立意过程就有了。\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/4/0/9/642904.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n修改点3：全App的配色体系，图标设计体系整理。完整的设计策略方案，这才是UI设计新手老手的分水岭。一套成熟的配色和图标设计体系会让你的App看起来高度统一。所以一定要建立成体系的配色体系。配色方法在我的UI设计书籍《术与道-移动应用设计必须课》已经讲解过了。\n最简单的展示方法就是从照片中取色。\n\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/5/0/9/642905.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/6/0/9/642906.png\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n\n修改点4：其实我非常想知道这是谁设计的模板，透视完全变形了。分享给大家很多新人都在用。这个模板并不好看啊？还是用这个模板比较好。因为只看局部界面。你可以把你觉得比较好看的界面放上去。界面不需要那么实在全部放上去。我们是视觉动物，界面展示还是应该有设计编排。\n\n\n内页展示B\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/8/0/9/642908.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n这是一个暗黑的设计，用了小恶魔的图形做为主图标也是非常契合的，标题字用了哥特字体，适应了整体风格的气质。可是画面太黑了，黑乎乎的我都不想看下去了。\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/9/0/9/642909.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n修改点1：这是早些年设计师喜欢用的方法，背景颜色深可以突出界面的炫酷感。但是整个界面就是黑乎乎一片，看起来很压抑。手机是前景，滑板是背景，要想让整个界面亮起来，手机就需要亮堂起来。iPhone手机壳可是金属的，反光特别好，而且这里需要一些反射\n环境光，让整体亮起来。如何修改了？看下图的圆图形的反射层部分那种非常柔和的光晕部分。\n\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/0/1/9/642910.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/1/1/9/642911.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/2/1/9/642912.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n\n这是内页展示的另外两页，依然是我之前说的那个问题，没有任何设计思路，就是单纯的套模板。你的专业面试官一定是套模板的老手了。他可是清楚的知道这是一件非常没有技术含量的事情。所以设计师请停止无意义的套模板展示，你需要在展示页清楚的表达你的设计思路。设计表现只是更好的表达你的设计思路。\n\n那么模板到底还能不能套了？我的答案是可以的，但要套的有价值。根据不同的情况，有选择的套模板。\n\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/3/1/9/642913.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n这种一组模板适用于展示一组界，这组界面具有相似的设计或者界面属性，可以通过一组共同展示，营造出和谐统一且有变化的效果。比如还可以用在一组引导画面的展示。\n\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/4/1/9/642914.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n对这个模板应该这样用，不要单独用，非常的单调。这样有了前后对比，界面就丰富了很多。\n\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/5/1/9/642915.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n这样一组模板就一般用在作品展示结尾，就是炫一下界面我很多很丰富，但有一个重要的关键点的，不要死板的把所有界面罗列在上面。可以把不是很好看的界面放在顶部，用一个半透明的渐变隐去一些细节。\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/6/1/9/642916.jpg\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n\n最后几页\n很多设计师犯这样的错误，认为我应该尽可能的向公司展现我有各种各样的能力，我做过很多项目。这个可以有，但我觉得在你没有做好设计展示前，这样拼凑的界面还是不要放在作品集了。这四张图，每个图一个风格，每个图都是放了寥寥几张图。这样的设计展示是非常不负责的。所以设计展示应该是不求大而全，而是少而精。\n\n\n最终修改的结果 \n让我们最后看一眼设计师修改后的简历效果，由于隐私，我截取了部分。\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/4/3/9/642934.png\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/5/3/9/642935.png\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n这个渐变的手法运用就是我说的渐变和前面呼应起来\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/6/3/9/642936.png\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n表情还待提高，拍照技术也待提高\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/8/3/9/642938.png\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n语言还是有点多哈，设计师还是靠图说话\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/9/3/9/642939.png\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n清晰的品牌logo露出\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/0/4/9/642940.png\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/1/4/9/642941.png\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/2/4/9/642942.png\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n图标说明有了\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/3/4/9/642943.png\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n层次还可以再丰富些\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/4/6/9/642964.png\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n有了颜色和图标的系统说明\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/4/4/9/642944.png\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n用心形进行了二次图形设计，运用了渐变颜色，显得颜色非常丰富\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/5/4/9/642945.png\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n图形的文字也经过重新设计，和整体氛围更贴合\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/6/4/9/642946.gif\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n可以动哦，效果不错！\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/7/4/9/642947.png\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/8/4/9/642948.png\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/9/4/9/642949.png\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/0/5/9/642950.png\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/1/5/9/642951.png\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/2/5/9/642952.png\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/3/5/9/642953.png\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/4/5/9/642954.png\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n烧字加入了渐变，让颜色更加丰富，且贴合整个作品集渐变的主题\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/5/5/9/642955.png\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/6/5/9/642956.png\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n四个墨迹不同，大小接近，保证了界面统一中有变化\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/7/5/9/642957.png\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n<img alt=\"Image title\" class=\"fr-fil fr-dib\" src=\"http://img.ui.cn/data/file/8/5/9/642958.png\" width=\"900\" style=\"vertical-align: top; width: inherit; height: inherit; max-width: 100%; margin-top: auto; margin-right: auto; margin-bottom: auto; display: block; overflow: auto; z-index: 1; position: relative; padding: 10px 10px 10px 3px; float: none !important;\">\n图形最后的重复，前后有了呼应\n\n好了，今天到这里，这是这位姑娘花了差不多一周时间修改的，我觉得提高非常大。希望我说的这些点能帮助到大家。好的设计作品集可以给你面试加分哦。\n\n记住作品集也是你的一个作品，要做有灵魂的作品集。\n\n如果有觉得自己简历不错的，也可以发我的邮箱。我也可以给你提一些意见！\n\n',NULL,'http://localhost:8080/MyBoke/resources/imgs/contentImg/201606081302527.jpg',NULL,NULL,NULL,'2016-06-08 15:10:15','2016-06-08 15:10:15','经验/观点',1,0,1,0,3,1,1,0,0,NULL,NULL,NULL,NULL,NULL),(68,153,'xdj','/resources/imgs/header_pic/headerpic.jpg','引导页设计思路及方法',NULL,'通过系统学习主流引导页设计方法和设计思路，解决以后对引导页的困惑。','<img src=\"http://img.ui.cn/data/file/2/0/4/641402.jpg\" alt=\"Image title\">\n',NULL,'http://localhost:8080/MyBoke/resources/imgs/contentImg/201606081312307.jpg',NULL,NULL,NULL,'2016-06-08 15:14:22','2016-06-08 15:14:22','经验/观点',1,0,1,0,3,1,1,0,0,NULL,NULL,NULL,NULL,NULL),(70,153,'xdj','/resources/imgs/header_pic/headerpic.jpg','独眼小拉 - 拉勾形象设计',NULL,'独眼小拉 - 拉勾形象设计','独眼小拉，独具慧眼。\n\n<a href=\"http://img.ui.cn/data/file/5/9/5/646595.gif