/*Table structure for table `music` */

DROP TABLE IF EXISTS `music`;

CREATE TABLE `music` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `title` varchar(100) DEFAULT NULL COMMENT '歌名',
  `description` varchar(255) DEFAULT NULL COMMENT '描述',
  `src` varchar(200) DEFAULT NULL COMMENT '音乐连接地址',
  `img` varchar(200) DEFAULT NULL COMMENT '图片',
  `singer` varchar(50) DEFAULT NULL COMMENT '歌手',
  `time` varchar(10) DEFAULT NULL COMMENT '播放时长',
  `size` text COMMENT '大小',
  `lrc` text COMMENT '歌词',
  `user_id` int(11) DEFAULT NULL COMMENT '用户id',
  `category_id` int(11) DEFAULT NULL COMMENT '音乐类型id',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更改时间',
  `is_delete` int(1) DEFAULT '0' COMMENT '0--未删除  1--已删除',
  `sort` int(1) DEFAULT NULL COMMENT '排序',
  `status` int(1) DEFAULT NULL COMMENT '0--未发布  1--已发布',
  `hits` int(11) DEFAULT NULL COMMENT '收听数',
  `loves` int(11) DEFAULT NULL COMMENT '喜欢数',
  `collections` int(1) DEFAULT NULL COMMENT '收藏数',
  `comments` int(11) DEFAULT NULL COMMENT '评论数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8;

