/*Table structure for table `user` */

DROP TABLE IF EXISTS `user`;

CREATE TABLE `user` (
  `userid` int(11) NOT NULL AUTO_INCREMENT,
  `role_id` int(11) DEFAULT NULL,
  `username` varchar(20) DEFAULT NULL,
  `userpassword` varchar(50) DEFAULT NULL,
  `ip` varchar(100) DEFAULT NULL,
  `ipaddress` varchar(100) DEFAULT NULL,
  `usersex` int(1) DEFAULT NULL COMMENT '1--男性  0--女性 2--保密',
  `userage` int(3) DEFAULT NULL,
  `useremail` varchar(20) DEFAULT NULL,
  `usertel` int(11) DEFAULT NULL,
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `header_pic` varchar(200) DEFAULT NULL,
  `forbiden` int(1) DEFAULT '0' COMMENT '1--禁止  0--未禁止',
  `active` int(1) DEFAULT '0' COMMENT '1--已激活  0--未激活',
  `is_delete` int(1) DEFAULT '0' COMMENT '1--已删除  0--未删除',
  `activeCode` char(32) DEFAULT NULL,
  `state` int(1) DEFAULT '0' COMMENT '1--普通用户 0--明星用户',
  `qq` varchar(10) DEFAULT NULL,
  `weixin` varchar(10) DEFAULT NULL,
  `birthday` datetime DEFAULT NULL,
  `address` varchar(200) DEFAULT NULL,
  `description` varchar(200) DEFAULT NULL,
  PRIMARY KEY (`userid`)
) ENGINE=InnoDB AUTO_INCREMENT=154 DEFAULT CHARSET=utf8;

